import React from 'react'; // Import the Component component from React
import {Link} from 'react-router-dom'; // Import the Link component
import '../css/App.css';
import HomepageProject from './homepageProject.js'

const panaseer = {
  'image':require("./../content/projects/panaseer/hero-image.png")
}

const joyStory = {
  'image':require("./../content/projects/joyStory/thumbnail.jpg")
}

function Home(props) {
  return (
    <div>
      <HomepageProject
       image={panaseer.image}
      />
      <HomepageProject
       image={joyStory.image}
      />
    </div>
  );
}

export default Home;
